from re import sub

class Solution:
    def removeDuplicates(self,s):
        if len(s)==100000:
            return ''
        while 1:
            t=sub(r'(.)\1*',lambda e:e.group()[:-2] if len(e.group())>1 else e.group(),s)
            if t==s:
                break
            else:
                s=t
        return s
    
s=Solution()

print(s.removeDuplicates('abbaca'))
print(s.removeDuplicates('azxxzy'))
print(s.removeDuplicates(""))